export default function List({ category, products }) {
  return (
    <div>
      <h2>{category}</h2>
      {products.map(({ id, product, brand, price }) => {
        return (
          <li>
            <p key={id}>{`${product} - ${brand} - $${price}`}</p>
          </li>
        );
      })}
    </div>
  );
}
